	public static int findMaxConsecutiveOnes(int[] nums) {
		System.out.println(nums.length);
		int maxLen = 0;
		int midLen = 0;
        for (int i = 0; i < nums.length; i++) {
			if (nums[i]==1) {
				midLen++;
			}
			if (midLen>maxLen) {
				maxLen = midLen;
			}
			if (nums[i]==0) {
				if (maxLen>nums.length/2) {
					break;
				}
				midLen = 0;
			}
		}
        
        return maxLen;
    }

